        const replacer = (key, value) => {
            if (!["results", "controls"/*, "times"*/].includes(key) && Array.isArray(value)) {
                if (Array.isArray(value[0])) {
                    return value;
                }
                return "[ " + value.join(", ") + " ]";
            }
            if ("results" === key) {
                return value.slice(0, 1);
            }
            return value;
        }

        const setTextContent = (elementId, textContent) => document.getElementById(elementId).textContent = textContent;

        const setJsonTextContent = (elementId, textContent) => document.getElementById(elementId).textContent = JSON.stringify(textContent, replacer, 2);
